    return (
        <>
            <div className="main_div">
                <div className="cent_div">
                    <br />
                    <h1>To Do List</h1>
                    <br />
                    <div className="input_btn">
                        <input type="text" placeholder="Add Items" />
                        <Tooltip title="Add">
                            <AddIcon className="add_item" />
                        </Tooltip>
                    </div>
                    <ToDoList />
                    <ToDoList />
                    <ToDoList />
                </div>
            </div>
        </>
    );
};

export default App;
